import React, { Component } from "react";
import { Link } from "react-router-dom";

function GeoInputs() {
    return (
        <label>
            <input type='text' placeholder='Latitude'></input>
        </label>
    )
}

export class Home extends Component {
    render() {
        return (
            <div>
                <Link to={'/'}>Back</Link>
                <GeoInputs />
            </div>
        )
    }
}
